import React from 'react'
import '../css/Style.css';
import NavBar from './rfc/NavBar';
import { useFormik } from 'formik';
// Composants Material-UI
import { TextField } from '@material-ui/core';

export default class CreationCommande extends React.Component {
    render() {
        return (
            <div>
                <header>
                    <NavBar />
                </header>
                <div className="content">
                    <Formik initialValues={{ test: 'test' }} onSubmit={data => {
                        console.log(data);
                    }}>
                        {({ values, handleChange, handleBlur, handleSubmit }) => (
                            <form onSubmit={handleSubmit}>
                                <TextField value={values.test} onChange={handleChange} onBlur={handleBlur} />
                            </form>
                        )}</Formik>
                </div>
            </div>
        )
    }
}
